import React from "react";

function ListCart(props) {
    return (
        <div className="row p-5">
            <a
                style={{
                    fontWeight: 700,
                    fontSize: 20
                }}
            >
                <p>barang id : {props.item.barang_id}</p>
                <p>{props.item.user_id}</p>
                <p>Rp {props.item.jumlah}</p>
            </a>
        </div>
    );
}
export default ListCart;
